import React from "react";
//import "./Footer.css";

const Footer = () => {
  return (
    <footer>
      <div className="footer-content">
        <div className="footer-logo">
          <img src="/images/logo.png" alt="AgricSmart" />
        </div>
        <nav className="footer-nav">
          <a href="#">About Us</a>
          <a href="#">Programs</a>
          <a href="#">Events</a>
          <a href="#">Join Our Team</a>
        </nav>
        <div className="footer-socials">
          <a href="#">Twitter</a>
          <a href="#">Instagram</a>
          <a href="#">Facebook</a>
        </div>
      </div>
      <p>&copy; 2018 AgricSmart. All rights reserved.</p>
    </footer>
  );
};

export default Footer;
